import icon from '/home/kauag/github/portifolio/src/imagens/code-slash.svg';
export default function About() {
  return (
    <section className="container" style={{ backgroundColor: '#34353C' }}>
      <img src={icon} alt="code Slash" />
      <div className="about">
        <h3 style={{ color: '#FCEAFF' }}>Discovery</h3>
        <h1 style={{ borderBottom: '2px red solid' }}>Sobre mim</h1>
      </div>
    </section>
  );
}
